import Navbar from './components/Navbar/Navbar';
import Banner from './components/Banner/Banner';
import Work from './components/Work/Work';
import Project from './components/Project/Project';


function App() {
  return (
    <div>
      <Navbar></Navbar>
      <Banner></Banner>
      <Work></Work>
      <Project></Project>
      <Design></Design>
    </div>
  );
}

export default App;
